import React from "react";

const Header = () => {
  return (
    <header>
      <h3>L&B</h3>
      <ul className="navbar-menu">
        <a>
          <li>Home</li>
        </a>
        <a>
          <li>Cellection</li>
        </a>
        <a>
          <li>Contact</li>
        </a>
      </ul>
      <div>
        <a>Cart</a>
      </div>
    </header>
  );
};

export default Header;
